import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import M from 'materialize-css';

class Navbar extends Component {

    componentDidMount = () => {
        document.addEventListener('DOMContentLoaded', function() {
            var elems = document.querySelectorAll('.sidenav');
            M.Sidenav.init(elems, {'edge': 'right'});
          });
    }

    render() {
    return (
        <nav className="nav-wrapper red darken-4">
            <div className="container">
                <Link to="/" className="brand-logo">Sho(ep)ping</Link>

                <a href="/" data-target="mobile-demo" className="sidenav-trigger right"><i className="material-icons">menu</i></a>
                <ul className="right hide-on-med-and-down">
                    <li><Link to="/">Shop</Link></li>
                    <li><Link to="/cart">My cart</Link></li>
                    <li><Link to="/cart"><span className="material-icons">shopping_cart</span><span class="new badge" data-badge-caption="custom caption">4</span></Link></li>
                </ul>

                <ul className="sidenav" id="mobile-demo" >
                    <li><Link to="/">Shop</Link></li>
                    <li><Link to="/cart">My cart</Link></li>
                    <li><Link to="/cart"><i className="material-icons">shopping_cart</i><span class="new badge white-text" data-badge-caption="items">4</span></Link></li>
                </ul>
            </div>
        </nav>
    )
}
}

export default Navbar
